import { useAxios } from "use-axios-client";
import axios from 'Axios';

const wx_url = 'https://mjgh1cx0le.execute-api.us-west-1.amazonaws.com/default/weatherAPI';

const WeatherTable = async () => {
  try {
       const response = await axios.get(wx_url)
       console.log('Response: ' + response);
  } catch(err) {
       console.log('err')
  }

  return (
    <div className="weather-container">
    <table>
      <tr>
        <div className="table-header">
          <th>Weather API Results</th>
          <p>Feel free to get creative!</p>
        </div>
      </tr>
      <tr>
        <td className="center">Results: </td>
      </tr>
    </table>
  </div>
  )
}
export default WeatherTable;
